import React, { useEffect, useState } from 'react';

const Friends = () => {
  
    const [friedns,setFriends]=useState([]);
    useEffect(()=>{
        fetch('https://jsonplaceholder.typicode.com/users')
        .then(res=>res.json())
        .then(data=>setFriends(data))
    },[])


    return (
        <div>
            <h2>This Is Friends Page</h2>
        </div>
    );
};

export default Friends;
